const Home = () => {
  return (
    <div class="main-home-wrapper">
      <div class="main-home-header">
        <pre>
          안녕하십니까! <br></br>한국교통대학교 소프트웨어학과 웹 어플리케이션
          동아리 f(x)입니다.
        </pre>
      </div>
      <div class="main-home-content">How about you?</div>
    </div>
  );
};

export default Home;
